INSERT INTO `recipes` (`id`, `name`, `description`, `instruction`, `ingredients`, `imagePath`, `imageData`, `imageMimeType`, `imageFileName`, `mealtype`, `cuisine`, `diet`, `fk_user`) VALUES
(2, 'Mushroom Lentil Burger & Fries', 'How To Eat Vegan On A Budget', 'Preheat the oven to 400°F (200°C).\r\nTo make the flax egg, combine the flax meal and water in a small bowl and stir. Set aside.\r\nIn a large saucepan, heat 1 tablespoon of olive oil over medium heat.\r\nOnce the oil begins to shimmer, add the mushrooms and cook until most of the juices have evaporated, 7-8 minutes.\r\nAdd the soy sauce and paprika and cook for 2-3 more minutes. Set aside in a large bowl.', '1 tablespoon  flax meal\r\n3 tablespoons  water\r\n3 tablespoons  olive oil, divided\r\n8 oz  mushrooms, finely chopped\r\n1 tablespoon  soy sauce\r\n½ teaspoon  smoked paprika\r\n1 small onion, diced\r\n2 cloves garlic, minced\r\n½ teaspoon  salt\r\n½ teaspoon  pepper\r\n1 ½ cups  lentils, cooked\r\n1 cup  oats', 'images/howtoeatveganonabudgetfbfinalnew.jpg', NULL, NULL, NULL, 'Breakfast', 'Canadian', 'Vegan', 4),
(3, 'Easy Juicy Chicken Marsala', 'Place the flour, salt, pepper, onion powder, and garlic powder in a wide, shallow dish and stir to combine. Dredge the chicken pieces in the flour mixture, shaking gently to remove any excess flour, and set aside.\r\nHeat the oil and 2 tablespoons of butter in a large skillet over medium-high heat. Add the chicken in batches to prevent overcrowding. Cook the chicken until golden brown, about 3 minutes. Flip and cook the other side, another 3 minutes. Remove the chicken from the pan and set aside.', 'Cut each chicken breast in half crosswise, then cut the larger, thicker half again horizontally, creating 3 equally thick cutlets. Place the flour, salt, pepper, onion powder, and garlic powder in a wide, shallow dish and stir to combine. Dredge the chicken pieces in the flour mixture, shaking gently to remove any excess flour, and set aside.\r\nHeat the oil and 2 tablespoons of butter in a large skillet over medium-high heat. Add the chicken in batches to prevent overcrowding. Cook the chicken until golden brown, about 3 minutes. Flip and cook the other side, another 3 minutes. Remove the chicken from the pan and set aside.', '4 boneless, skinless chicken breasts, trimmed\r\n1 cup  all-purpose flour\r\nsalt, to taste\r\npepper, to taste\r\n1 tablespoon  onion powder\r\n1 tablespoon  garlic powder\r\n2 tablespoons  olive oil\r\n4 tablespoons  butter, divided', 'images/fb_1.jpg', NULL, NULL, NULL, 'Breakfast', 'Canadian', 'Vegan', 4),
(4, 'Gourmet Salmon Dinner', 'Make the sauteed vegetables: Heat a drizzle of olive oil in a large pan over medium heat. Add the mushrooms and cook for 5 minutes, stirring occasionally, until starting to soften.', 'Make the creamy shallot potato puree: Melt 3 tablespoons of butter in a medium pan over medium-high heat. Add the shallots and cook for 3-4 minutes, until softened.\r\nAdd the garlic and another tablespoon of butter and continue to cook for another 3-4 minutes, stirring frequently, until the shallots are browned.\r\nAdd the milk, white pepper, and salt and stir to incorporate.\r\nTransfer the shallot mixture to a food processor and process until smooth.', '4 tablespoons  butter, divided\r\n2 shallots, thinly sliced\r\n2 cloves garlic, minced\r\n⅓ cup  whole milk\r\n1 ½ teaspoons  white pepper\r\n1 teaspoon  salt\r\n2 lb  yellow potato, peeled, quartered, and boiled until tender', 'images/bfv28280easysalmondinnervsgourmetsalmondinnerfbv4.jpg', NULL, NULL, NULL, 'Dinner', 'French', 'Pescatarian', 4),
(5, 'Fresh Blueberry Pie III', 'Delicious blueberry pie made with a combination of fresh and cooked blueberries and a pre-baked pie shell', 'Preheat oven to 375 degrees F (190 degrees C). Prepare crust.\r\nIn a large bowl, combine flour,1/4 teaspoon salt and 3 tablespoons sugar. Add oil and milk and mix together. Roll out and line a 9 inch pie pan. Bake at 375 degrees F (190 degrees C) for 10 minutes or until golden brown.', '1 cup all-purpose flour1/4 teaspoon salt3 tablespoons white sugar1/3 cup vegetable oil1 1/2 tablespoons milk2 cups fresh blueberries2 cups fresh blueberries', 'images/258837.jpg', NULL, NULL, NULL, 'Desserts', 'vague', 'Vegetarian', 4);
INSERT INTO `recipes` (`id`, `name`, `description`, `instruction`, `ingredients`, `imagePath`, `imageData`, `imageMimeType`, `imageFileName`, `mealtype`, `cuisine`, `diet`, `fk_user`) VALUES
(6, 'Grilled Steak', 'Choose well-marbled cuts such as porterhouse, rib eye, T-bone, tenderloin (filet mignon), or top loin (New York or strip) about 1 inch thick. If meat is thicker-up to 2 inches-use medium heat (you can hold your hand at grill level only 3 to 4 seconds) and allow extra time-up to 20 minutes for a medium-rare 2-inch-thick steak, 25 for medium.', 'Step 1\r\nIf using charcoal briquets, ignite 65 to 75 briquets (about 4 1/2 lb.) on the firegrate; open dampers. When coals are dotted with ash, in 15 to 20 minutes, spread into an even, solid layer and allow to burn down until they are hot (you can hold your hand at grill level only 2 to 3 seconds), 5 to 10 minutes.\r\n\r\nStep 2\r\nIf using a gas barbecue, turn all burners to high and close lid for at least 10 minutes, then adjust to desired heat.\r\n\r\nStep 3\r\nTrim and discard excess fat from steaks (dripping fat can cause flare-ups). Rinse steaks and pat dry. Sprinkle lightly all over with salt and pepper.\r\n\r\nStep 4\r\nLay steaks on grill 4 to 6 inches above heat; close lid on gas barbecue. Cook until done to your liking, 6 to 8 minutes for medium-rare (cut to test; see notes), turning once with a wide spatula or tongs halfway through cooking. Transfer to a board or platter and let rest about 5 minutes before serving.\r\n\r\nStep 5\r\nNutritional analysis per 8-ounce steak (uncooked).', 'Steak, Tomato, Lemon', 'images/steak.png', , 'jpg', 'steak01', 'Grilling & BBQ', 'Canadian', 'Lactose free', 1);
