(7, 'Slow-Cooker Pepper Steak', 'Very tender and flavorful, this recipe is one of our family\'s favorites. It\'s great to make ahead of time in the slow cooker and then serve over rice, egg noodles, or chow mein', 'Very tender and flavorful, this recipe is one of our family\'s favorites. It\'s great to make ahead of time in the slow cooker and then serve over rice, egg noodles, or chow mein', 'Very tender and flavorful, this recipe is one of our family\'s favorites. It\'s great to make ahead of time in the slow cooker and then serve over rice, egg noodles, or chow mein', 'images/496244.jpg', NULL, NULL, NULL, 'Dinner', 'Chinese', 'Gluten free', 4);

